    <h1>Form using css</h1>
    <br>
    <!--This is the input tag which I have used from getbootstrap.com. in the first div tag I used container and for the second div tag I have use jumbotron and inside this tag I have provided the input datas-->
    <div class="container">
        <div class="jumbotron" style="background-color:rgb(233, 180, 228)">
            <form>
                <div class="row">
                <div class="col">
                    <input type="text" class="form-control" placeholder="First name">
                </div>
                <div class="col">
                    <input type="text" class="form-control" placeholder="Last name">
                </div>
                </div>
            </form>
            <br>
            <form>
                <div class="form-group">
                    <input type="text" class="form-control" id="formGroupExampleInput" placeholder="CID Number">
                </div>
                <div class="form-group">
                    <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="DID Number">
                </div>
            </form>
            <form>
                <div class="form-row">
                <div class="form-group col-md-6">
                    <input type="email" class="form-control" id="inputEmail4" placeholder="Email">
                </div>
                <div class="form-group col-md-6">
                    <input type="password" class="form-control" id="inputPassword4" placeholder="Password">
                </div>
                </div>
                <div class="form-group">
                <label for="inputAddress">Address</label>
                <input type="text" class="form-control" id="inputAddress" placeholder="1234 Main St">
                </div>
                <div class="form-group">
                <label for="inputAddress2">Address 2</label>
                <input type="text" class="form-control" id="inputAddress2" placeholder="Apartment, studio, or floor">
                </div>
                <div class="form-row">
                <div class="form-group col-md-6">
                    <input type="text" class="form-control" id="inputCity" placeholder="City">
                </div>
                <!-- For this div tag i have use the select button where the user can choose the place they are from. For this div tag i have provided the class as form-group col-md-4-->
